/*
   CRM路由
*/
const bodyfeaturesDetails = resolve => require(['@/views/crm/bodyfeatures/bodyfeatures_details.vue'], resolve)

const customerDetails= resolve => require(['@/views/crm/customer/customer_details.vue'], resolve);
const measureDetails= resolve => require(['@/views/crm/measurement/measure_details.vue'], resolve)
export default [ {
    path : '/crm',
    name:'crm',
    component : resolve => require(['@/views/index'], resolve),
    //redirect : 'index_list',
    children : [{
        path : '/crm/customer/edit_customer',
        name : 'edit_customer',
        component :customerDetails,
        meta: {
            title: '修改信息',
            topBar:true,
          }
      },{
        path : '/crm/customer/show_customer',
        name : 'show_customer',
        component :customerDetails,
        meta: {
            title: '查看信息',
            topBar:true,
          }
      },{
        path : '/crm/measurement/add_measure',
        name : 'add_measure',
        component :measureDetails,
        meta: {
            title: '新增测量项',
            topBar:true,
          }
      },{
        path : '/crm/measurement/edit_measure',
        name : 'edit_measure',
        component :measureDetails,
        meta: {
            title: '修改测量项',
            topBar:true,
          }
      },{
        path : '/crm/measurement/show_measure',
        name : 'show_measure',
        component :measureDetails,
        meta: {
            title: '查看测量项',
            topBar:true,
          }
      },{
        path : '/crm/bodyfeatures/add_bodyfeatures',
        name : 'add_bodyfeatures',
        component :bodyfeaturesDetails,
        meta: {
            title: '新增体型特征',
            topBar:true,
          }
      },{
        path : '/crm/bodyfeatures/edit_bodyfeatures',
        name : 'edit_bodyfeatures',
        component :bodyfeaturesDetails,
        meta: {
            title: '修改体型特征',
            topBar:true,
          }
      },{
        path : '/crm/bodyfeatures/show_bodyfeatures',
        name : 'show_bodyfeatures',
        component :bodyfeaturesDetails,
        meta: {
            title: '查看体型特征',
            topBar:true,
          }
      }]
}
]
